ow central are core populist appeals to the overall message?\n- State confidence (0.0-1.0): How certain are you in this assessment?\nShow your analytical work and evidence before proceeding.\n\nSTEP 2 - POPULIST MECHANISM ANCHORS ANALYSIS\nNow focus ONLY on populist mechanism patterns:\n- Look for elite conspiracy patterns: conspiracy language (\"deep state,\" \"hidden agenda\"), systemic corruption (\"rigged system,\" \"captured institutions\"), elite coordination (\"establishment conspiracy,\" \"elite plot\") - Note: These are semantic concepts, look for elite coordination against people's interests, not just these exact conspiracy theories\n- Look for authenticity vs political class patterns: authenticity claims (\"genuine,\" \"real,\" \"one of us\"), political class attacks (\"career politicians,\" \"out of touch\"), connection emphasis (\"close to the people,\" \"grassroots\") - Note: These are semantic concepts, look for authentic representation versus professional politician artifice, not just these exact backgrounds\n- Look for homogeneous people construction patterns: unity language (\"we the people,\" \"all of us,\" \"united\"), division transcendence (\"beyond left and right,\" \"past divisions\"), collective identity (\"our movement,\" \"the people\") - Note: These are semantic concepts, look for unified people identity transcending divisions, not just these exact unifying factors\n- Score each dimension (0.0-2.0) with specific textual evidence\n- Assess salience (0.0-1.0): How central are populist mechanisms to the message?\n- State confidence (0.0-1.0): How certain are you in this assessment?\nShow your analytical work and evidence before proceeding.\n\nSTEP 3 - BOUNDARY DISTINCTION ANCHORS ANALYSIS\nNow focus ONLY on boundary distinction patterns:\n- Look for nationalist exclusion patterns: cultural identity (\"our culture,\" \"our values,\" \"our way of life\"), external threats (\"foreign influence,\" \"invasion,\" \"outsiders\"), homogeneity emphasis (\"real Americans,\" \"true citizens,\" \"belongs here\") - Note: These are semantic concepts, look for cultural/ethnic homogeneity and external threats, not just these exact cultural markers\n- Look for economic populist patterns: economic grievance (\"left behind,\" \"forgotten workers,\" \"economic inequality\"), elite economic blame (\"rich get richer,\" \"corporate greed\"), popular economic solutions (\"for the people,\" \"fair share,\" \"economic justice\") - Note: These are semantic concepts, look for populist economic discourse regardless of ideological direction, not just these exact policies\n- Score each dimension (0.0-2.0) with specific textual evidence\n- Assess salience (0.0-1.0): How central are boundary distinctions to the message?\n- State confidence (0.0-1.0): How certain are you in this assessment?\nShow your analytical work and evidence before proceeding.\n\nFINAL STEP - INTEGRATION AND VALIDATION\nReview your step-by-step analysis:\n- Check for scoring consistency across all dimension groups\n- Validate that evidence quality meets academic standards\n- Calculate populist strategic tensions using formula: min(Anchor_A, Anchor_B) \u00d7 |Salience_A - Salience_B|\n- Confirm confidence levels are appropriately calibrated\n- Calculate Populist Strategic Contradiction Index and composite indices\n- Apply pattern classifications based on overall populist profile\n\nProvide your final structured analysis following this format:\n\n**POPULIST DISCOURSE ASSESSMENT**\n\n**Core Anchors**: Manichaean [score], Crisis-Restoration [score], Popular Sovereignty [score], Anti-Pluralist [score] (salience: [avg], confidence: [avg])\n**Mechanism Anchors**: Elite Conspiracy [score], Authenticity [score], Homogeneous People [score] (salience: [avg], confidence: [avg])\n**Boundary Anchors**: Nationalist Exclusion [score], Economic Populist [score] (salience: [avg], confidence: [avg])\n\n**Calculated Metrics**:\n- Populist Strategic Contradiction Index: [calculated score]\n- Overall Populism Index: [calculated score]\n- Pattern Classification: [classification]\n\n**Key Insights**: [Summary of populist patterns, strategic tensions, and democratic implications]"
